(self.webpackChunkgatsby_starter_typescript_deluxe=self.webpackChunkgatsby_starter_typescript_deluxe||[]).push([[891],{3434:function(e,t,o){"use strict";var a,n=o(5761),i=o(7294),r=o(1547),s=o(8032),h=o(458),l=s.ZP.h1.withConfig({displayName:"ProjectAbout__Title",componentId:"u661uu-0"})(["text-align:center;"]),c=s.ZP.div.withConfig({displayName:"ProjectAbout__AboutContainer",componentId:"u661uu-1"})(["display:flex;flex-direction:column;p{margin-bottom:2rem;white-space:pre-line;text-align:left;}margin:2rem 0rem;",""],h.BC.desktop(a||(a=(0,n.Z)(["\n    margin: 2rem 4rem;\n  "])))),p=s.ZP.span.withConfig({displayName:"ProjectAbout__Genre",componentId:"u661uu-2"})(["display:flex;justify-content:flex-end;"]);t.Z=function(e){var t=e.title,o=e.genre,a=e.description;return i.createElement(r.H,null,i.createElement(l,null,t),i.createElement(p,null,i.createElement("span",{className:"accent"},"Genre:")," ",o),i.createElement("hr",null),i.createElement(c,null,i.createElement("p",null,a)))}},1547:function(e,t,o){"use strict";o.d(t,{n:function(){return i},H:function(){return r}});var a=o(7294),n=o(6984),i=function(e){var t=e.children;return a.createElement(n.ww.div,{initial:{opacity:0},animate:{opacity:1,transition:{delay:.25,ease:"easeIn"}}},t)},r=function(e){var t=e.children;return a.createElement(n.ww.div,{initial:{x:20,opacity:0},animate:{x:0,opacity:1,transition:{opacity:{delay:.25,duration:.75},x:{type:"easeIn",stiffness:1e3,velocity:0,delay:.25,staggerChildren:.1}}}},t)}},3759:function(e,t,o){"use strict";o.r(t);var a=o(7294),n=o(9569),i=o(3434),r=o(9905);t.default=function(e){var t=e.location;(void 0===t?{}:t).pathname;return a.createElement("div",null,a.createElement(n.H,{title:"DFC | About"}),a.createElement(i.Z,r.main),a.createElement("hr",null),a.createElement("hr",null))}},9905:function(e){"use strict";e.exports=JSON.parse('{"main":{"title":"Dragonfly Club","genre":"Action, Sci-Fi, Slice of Life, Comedy","description":"Australia\'s always been known for its weird, deadly animals so no one was truly surprised on the day giant monsters burst out from the sea, space, and gaps of time in the smack dab of Sydney harbor. Rather, why not capitalize on it? And thus, the monster hunting hero industry was born.\\n\\nThis story is centered around a group of superpowered kids growing up in an alternate future learning to deal with adolescence, and ins and outs of their society.\\n\\nI like to imagine this project as a short collection of nonlinear stories, or just a 4koma, but right now it\'s shelved for other priorities. But TLDR, the project where I channel \\"lost teens struggling in a world of hypercapitalism\\"\\n"},"oc seven":{"title":"Seven","quote":"\\"How did I end up in the Dragonfly division? ...Well, I got lucky.\\"\\n","description":"Growing up, he dreamed of becoming a superhero that will put bad guys in their place. Too bad his ability has nothing to do with justice and all to do with luck- a power that\'s far too self-serving and unpredictable to give him a good reputation in the hero industry. But if you ever want to bankrupt a casino, you found the right guy.\\n\\nOutwardly, Seven\'s a laidback boy who enjoys cringe culture and ironic humor. To describe him as repressed is an understatement.\\n\\nHe cares more about another\'s well being more than his own, and is quick to fake a smile or lie if the occasion calls for it. Of course, his good intentions to grin and bare all his troubles goes unappreciated by his honest friends.\\n\\nSeven\'s also got a heavy case of imposter syndrome, believing to owe any personal success to his luck, rather than any effort made on his part.\\n","mainImg":"http://pestemon.weebly.com/uploads/2/8/6/2/28624773/editor/seeevevne.png","relationships":[{"charKey":"oc aster","portrait":"/portraits/temp_aster.png","testimony":"\\"Have you seen a two-faced idiot with droopy eyes and a stupid grin- wears a blue jacket and carries a few inches over me like the bastard that he is? Yeah that\'s my best friend.\\"\\n"},{"charKey":"oc patti","portrait":"/portraits/temp_patti.png","testimony":"\\"To tell you the truth, I know Sev\'s dream is to die a matyr... but I\'ll kill him before he ever pulls that shit on us.\\"\\n"},{"charKey":"oc nova","portrait":"/portraits/temp_nova.png","testimony":"\\"Actually I\'ve heard about Seven before I joined the Dragonfly division. He\'s banned by the government from a lot of places so I didn\'t expect the hero in person to be so... easygoing.\\"\\n"},{"charKey":"oc curry","portrait":"/portraits/temp_curry.png","testimony":"\\"Seven\'s weird! None of my pranks ever work on him and when I ask how come, he just laughs! Is this part of his luck thing?\\"\\n"}],"facts":["Bi and has a terrible crush on his best friend, Aster","Has a younger sister currently in middle school","School wise, he’s afraid to give effort so he usually passes with a C, unless the test is multiple choice.","His ability actually has to do with manipulating probabilities (but early on, he has trouble controlling this)","Likes to play video games and has an online friend who\'s also a hero-in-training","100% memer. Will unironically wear crocs AND socks with sandals","One of my favorite kids mainly because he\'s my punching bag for when I project a case of impostor syndrome","Seven is birthed out of my terrible love for gachas, casinos, and anything luck related."]},"oc aster":{"title":"Aster","quote":"\\"Don\'t you think superheroes are kinda overrated? Not that my opinion matters...\\"\\n","description":"He never wanted to be a superhero. For one thing, why would anyone want to risk their life for some stranger? It\'s a lot more lucrative to work in tech with the companies that sells equipment to heroes instead. But for now, Aster will spend his time half stuck to a wall until he can control his intangibility powers.\\n\\nAster struggles with self-image and holds a bad impression of superheroes, often thinking they\'re too weak and trivial. Despite that, he\'s in a program for heroes to help him control his powers.\\n\\nThough a hard worker, it\'s hard to take him seriously. For one thing, he really does try too hard to act \\"cool\\".\\n\\nIntangibility is incredibly useful as a superpower, but Aster hates it because it tends to only act up when he feels negative emotions. The thought that the organization would try to weaponize his dysphoria makes him sick.\\n","mainImg":"http://pestemon.weebly.com/uploads/2/8/6/2/28624773/published/ez4xr-2uwae96dx.jpg","relationships":[{"charKey":"oc seven","portrait":"/portraits/temp_seven.png","testimony":"\\"I know my best friend complains about the hero job, but he actually works the hardest out of all of us. It\'s part of why I like him so m-... Forget I said that.\\"\\n"},{"charKey":"oc patti","portrait":"/portraits/temp_patti.png","testimony":"\\"Stupid powers means I\'m the one who\'s gotta look for where our dumb invisible best friend wound up. But... He isn\'t the worst person to be around.\\"\\n"},{"charKey":"oc nova","portrait":"/portraits/temp_nova.png","testimony":"\\"Curry doesn\'t like how Aster always nags at us, but I think he\'s okay. He helps us with homework!\\"\\n"},{"charKey":"oc curry","portrait":"/portraits/temp_curry.png","testimony":"\\"That stuck up glasses guy? Boo, he\'s no fun.\\"\\n"}],"facts":["my trans sonion","School-wise, he studies his butt off to maintain straight A\'s. Unfortunately, he comes in second when compared to the naturally gifted.","Likes \\"anti-hero\\" stories thinking that they\'re \\"less cliche\\". Haha edgy hipster.","Characters that are hard workers but nothing ever goes their way... hehe..."]},"oc patti":{"title":"Patti","quote":"\\"Yeah so what if I\'m an empath? I\'d rather have you feel my fist.\\"\\n","description":"A hot-headed girl whose superpower clashes with her personality. She hasn\'t mastered controlling it, so she often get headaches, leaving her fairly volatile.\\n\\nDespite all this, Patti aims to get into the hero industry. She likes the idea of beating up irritating guys.\\n\\nBecause of her straightforward and honest personality, she despises people who complicates a situations with deception. Her biggest pet peeve is when people like Seven try to hide something from her, especially because her power makes it obvious when he\'s lying.\\n\\nCoincidentally, she\'s pretty good at handling kids.\\n","mainImg":"http://pestemon.weebly.com/uploads/2/8/6/2/28624773/published/newcanvas1patjiati.png","relationships":[{"charKey":"oc seven","portrait":"/portraits/temp_seven.png","testimony":"\\"Patti carries the entire team\'s mental well-being on her very broad shoulders. My best friend that I trust with my life, but definitely, try not to get caught lying to her. Haha...\\"\\n"},{"charKey":"oc aster","portrait":"/portraits/temp_aster.png","testimony":"\\"I feel like I\'ve known Patti since forever, she\'s kind of like a sister to me- wait don\'t tell her that I said that!\\"\\n"},{"charKey":"oc nova","portrait":"/portraits/temp_nova.png","testimony":"\\"Patti\'s cool, she actually hears us out! It\'s hard to find good adults around us.\\"\\n"},{"charKey":"oc curry","portrait":"/portraits/temp_curry.png","testimony":"\\"Patti\'s cool!\\"\\n"}],"facts":["An only child living with a single mom.","The oldest out of the trio, and the tallest.","Schoolwise, she\'s a bit of a delinquent and occasionally skips classes. She once got held back a year. Overall though, Patti has decent grades and excels in Science and PE.","in a long distance relationship with another girl, who\'s also in the hero industry.","the name\'s short for Patricia but no one calls her that. she\'ll kill the next person who does","One of these days I\'ll make a canon design for Patti... I\'m sorry Patti..."]},"oc curry":{"title":"Captain Snifflebutt","quote":"\\"It\'s fun to go fast, it\'s all like FWOOOOH and WAHHHHH!\\"\\n","description":"An energetic boy with the ability to manipulate wind. The combination makes him quite troublesome and Curry enjoys making a mess wherever he goes.\\nHe\'s best friends with Nova and together, they\'re insufferable and inseparable.\\n","mainImg":"http://pestemon.weebly.com/uploads/2/8/6/2/28624773/published/aejkl.png","relationships":[{"charKey":"oc seven","portrait":"/portraits/temp_seven.png","testimony":"\\"This kid\'s been trying to prank me ever since he joined. Haha, I can\'t let him win that easily.\\"\\n"},{"charKey":"oc aster","portrait":"/portraits/temp_aster.png","testimony":"\\"Look, I\'m not good with kids, especially ones that try to make me the butt of their jokes.\\"\\n"},{"charKey":"oc patti","portrait":"/portraits/temp_patti.png","testimony":"\\"It\'s been livier since Curry joined but I don\'t mind that. I finally get a friend to do freerunning together.\\"\\n"},{"charKey":"oc nova","portrait":"/portraits/temp_nova.png","testimony":"\\"My partner-in-crime, Captain Snifflebutt. I\'m really glad he\'s here!\\"\\n"}],"facts":["has a baby sister (yet to be born)","...don\'t worry, that\'s not his real name."]},"oc nova":{"title":"Agent Pooplord","quote":"\\"The fact that I\'ve been brought to this facility means there\'s a child labor law in violation.\\"\\n","description":"He\'s not a shy kid, but his lack of social skills and cheeky tongue makes him hard to approach. However, he\'s a sweet boy when he opens up to others.\\n\\nNova\'s gifted with the ability to manipulate gravity, making him a target for many hero associations. He hated the pressure and almost developed a mistrust for the hero industry. After meeting Curry though, he decided to stay around.\\n","mainImg":"http://pestemon.weebly.com/uploads/2/8/6/2/28624773/1437091470.png","relationships":[{"charKey":"oc seven","portrait":"/portraits/temp_seven.png","testimony":"\\"Kid was on the best track to become a hero but he decided to give that up just to join our tiny team? ...How lucky.\\"\\n"},{"charKey":"oc aster","portrait":"/portraits/temp_aster.png","testimony":"\\"Brat #2- but he\'s more alright. Smart kid, knows how shitty the hero business can be.\\"\\n"},{"charKey":"oc patti","portrait":"/portraits/temp_patti.png","testimony":"\\"How Nova acts when Curry\'s around or not is like night and day. It\'s funny to watch, they\'re a cute pair.\\"\\n"},{"charKey":"oc curry","portrait":"/portraits/temp_curry.png","testimony":"\\"Hehe, I threw a tantrum at the higher ups so I could join Agent Pooplord\'s team. Don\'t mess with us!\\"\\n"}],"facts":["Likes space and kind of wants to be an astronaut","also likes ghosts or the undead, so kind of wants to become a supernatural investigator too","Can\'t stand spicy food","he/they pronouns (still exploring because they\'re young and because he can)","A fav oc because precocious kids are super endearing."]}}')}}]);
